import React from 'react';
import './Card.css'

const Card = (props) => {
    console.log(props.card);
    const {name,img,salary, location,level,age,Available, email,key} =props.card;
    return (
        <div>
            <div className="card-image">
                <img src={img} alt=""/>
            </div>
            <h2> {name}</h2>
            <h2> Developer ID:{key}</h2>
            <h4> Hourly payment($):{salary}</h4>
            <h4> Home town:{location}</h4>
            <h4> Age:{age}</h4>
            <h4> Competency:{level}</h4>
            <h3> Available for work:{Available}</h3>
            <h3>Email:{email}</h3>
            <button>Add to Team</button>

        </div>
    );
};

export default Card;
